import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';

function Predictor() {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    DepTimeMinutes: 0,
    CRSArrTimeMinutes: 0,
    TaxiIn: 0.0,
    TaxiOut: 0.0,
    CarrierDelay: 0.0,
    WeatherDelay: 0.0,
    NASDelay: 0.0,
    LateAircraftDelay: 0.0,
  });

  const [result, setResult] = useState(null);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: parseFloat(e.target.value) });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:8000/predict', formData);
      setResult(response.data);
    } catch (error) {
      console.error("Prediction error:", error);
    }
  };

  return (
    <div className="container my-5">
      <div className="card shadow-sm">
        <div className="card-body">
          <h1 className="text-center mb-4">Flight Delay Prediction</h1>
          <button onClick={() => navigate('/')} className="btn btn-primary w-100 mb-3">
            Go Back to Home
          </button>
          <form onSubmit={handleSubmit}>
            <div className="row mb-3">
              <div className="col-md-6">
                <label className="form-label">Dep Time (Minutes)</label>
                <input type="number" className="form-control" name="DepTimeMinutes" onChange={handleChange} />
              </div>
              <div className="col-md-6">
                <label className="form-label">CRS Arr Time (Minutes)</label>
                <input type="number" className="form-control" name="CRSArrTimeMinutes" onChange={handleChange} />
              </div>
            </div>
            <div className="row mb-3">
              <div className="col-md-6">
                <label className="form-label">Taxi In</label>
                <input type="number" className="form-control" name="TaxiIn" onChange={handleChange} />
              </div>
              <div className="col-md-6">
                <label className="form-label">Taxi Out</label>
                <input type="number" className="form-control" name="TaxiOut" onChange={handleChange} />
              </div>
            </div>
            <div className="row mb-3">
              <div className="col-md-6">
                <label className="form-label">Carrier Delay</label>
                <input type="number" className="form-control" name="CarrierDelay" onChange={handleChange} />
              </div>
              <div className="col-md-6">
                <label className="form-label">Weather Delay</label>
                <input type="number" className="form-control" name="WeatherDelay" onChange={handleChange} />
              </div>
            </div>
            <div className="row mb-4">
              <div className="col-md-6">
                <label className="form-label">NAS Delay</label>
                <input type="number" className="form-control" name="NASDelay" onChange={handleChange} />
              </div>
              <div className="col-md-6">
                <label className="form-label">Late Aircraft Delay</label>
                <input type="number" className="form-control" name="LateAircraftDelay" onChange={handleChange} />
              </div>
            </div>
            <button className="btn btn-primary w-100 mb-3" type="submit">Predict Delay</button>
          </form>

          {result && (
            <div className="mt-4">
              <h3 className="text-center">Prediction Result</h3>
              <p className="text-center">Prediction: {result.prediction}</p>
              <p className="text-center">Probability of Delay: {result.probability_of_delay}</p>
              <Link to="/visuals" state={{ result, formData }}>
                <button className="btn btn-secondary w-100 mt-3">Show Visuals</button>
              </Link>
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default Predictor;
